import React, { Fragment, useState, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import Breadcrumb from "../../common/breadcrumb";
import { Grid, List, ChevronDown } from "react-feather";
import banner from "../../../assets/images/ecommerce/12.jpg";
import errorImg from "../../../assets/images/search-not-found.png";
import Modal from "react-responsive-modal";
import Carousal from "./filters/carousal";
import AllFilters from "./filters/allfilters";
import { SORT_BY } from "../../../redux/actionTypes";
import axios from "axios";
import { ServerUrl } from "../../../constant";
import Loader from "../../common/loader";
import { withRouter } from "react-router";
import { compose } from "redux";
import { connect } from "react-redux";
import { addToCart } from "../../../redux/ecommerce/cart/action";
import Cookies from "js-cookie";
import {
  Filters,
  ShowingProducts,
  NotFoundData,
  ProductDetails,
  Quantity,
  ViewDetails,
  ProductSizeArray,
} from "../../../constant";
import allProducts from "./AllProducts";
const EcommerceApp = (props) => {
  const layoutColumns = 3;
  const data = useSelector((content) => content.Product.productItems);
  const filters = useSelector((content) => content.Filters);
  // const products = allProducts;
  // const products = getVisibleproducts(data, filters)
  const symbol = useSelector((content) => content.Product.symbol);
  const dispatch = useDispatch();

  const [singleProduct, setSingleProduct] = useState([]);
  const [searchKeyword, setSearchKeyword] = useState("");
  const [sidebaron, setSidebaron] = useState(true);
  // eslint-disable-next-line
  const [stock, setStock] = useState("");
  const [quantity, setQuantity] = useState(1);
  const [open, setOpen] = useState(false);
  const [filterSidebar, setFilterSidebar] = useState(true);
  const [loaderFlag, setLoaderFlag] = useState(false);
  const [products, setProducts] = useState([]);

  const onCloseModal = () => {
    setOpen(false);
  };
  const setAllProducts = (data) => {
    setProducts(data);
    setLoaderFlag(false);
  };
  useEffect(() => {
    setLoaderFlag(true);
    axios
      .get(
        `${ServerUrl}/product/findByCategory/${props.match.params.type}/${props.match.params.subType}`
      )
      .then((res) => setAllProducts(res.data))
      .catch((err) => setLoaderFlag(false));

    // dispatch(watchfetchProducts());
  }, [props.match.params.type, props.match.params.subType]);

  const filterSortFunc = (event) => {
    dispatch({ type: SORT_BY, sort_by: event });
  };

  const gridLayout = () => {
    document
      .querySelector(".product-wrapper-grid")
      .classList.remove("list-view");
    var elems = document.querySelector(".gridRow").childNodes;
    [].forEach.call(elems, function (el) {
      el.className = "";
      el.classList.add("col-xl-3");
      el.classList.add("col-sm-6");
      el.classList.add("xl-4");
    });
  };
  //Grid Layout View
  const listLayout = () => {
    document.querySelector(".product-wrapper-grid").classList.add("list-view");
    var elems = document.querySelector(".gridRow").childNodes;
    [].forEach.call(elems, function (el) {
      el.className = "";
      el.classList.add("col-xl-12");
    });
  };

  // Layout Column View
  const LayoutView = (layoutColumns) => {
    if (
      !document
        .querySelector(".product-wrapper-grid")
        .classList.contains("list-view")
    ) {
      var elems = document.querySelector(".gridRow").childNodes;
      [].forEach.call(elems, function (el) {
        el.className = "";
        el.classList.add("col-xl-" + layoutColumns);
      });
    }
  };

  const onClickDetailPage = (product) => {
    const id = product.id;
    props.history.push(
      `${process.env.PUBLIC_URL}/ecommerce/product-detail/${id}`
    );
  };

  const onClickFilter = () => {
    if (sidebaron) {
      setSidebaron(false);
      document.querySelector(".product-wrapper").classList.add("sidebaron");
    } else {
      setSidebaron(true);
      document.querySelector(".product-wrapper").classList.remove("sidebaron");
    }
  };

  const minusQty = () => {
    if (quantity > 1) {
      setStock("InStock");
      setQuantity(quantity - 1);
    }
  };

  const onOpenModal = (productId) => {
    setOpen(true);
    products.map((product, i) => {
      if (product._id === productId) {
        setSingleProduct(product);
      }
      return 0;
    });
  };

  const plusQty = () => {
    if (quantity >= 1) {
      setQuantity(quantity + 1);
    } else {
      setStock("Out of Stock !");
    }
  };

  const changeQty = (e) => {
    setQuantity(parseInt(e.target.value));
  };

  const addcart = async (product, qty) => {
    //make axios call here and
    let loggedInUseer = JSON.parse(Cookies.get("user"));
    await axios
      .put(
        `${ServerUrl}/api/carts/updateCart/increment/${loggedInUseer._id}/${product._id}`,
        {}
      )
      .then(async function (response) {
        await getCartData();
      })
      .catch(function (error) {
        console.log("error", error);
      });
  };
  const getCartData = async () => {
    let loggedInUseer = JSON.parse(Cookies.get("user"));
    await axios
      .get(`${ServerUrl}/api/carts/${loggedInUseer._id}`)
      .then(async (res) => setCartDataInRedux(res.data))
      .catch((err) => console.log(false));
  };
  const setCartDataInRedux=async (data)=>{
    await localStorage.setItem("cartData", JSON.stringify(data))
    await props.addToCart(data);
  }
  const addWishList = (product) => {
    dispatch({ type: "ADD_TO_WISHLIST", payload: product });
    props.history.push(
      `${process.env.PUBLIC_URL}/ecommerce/wishlist/${product.id}`
    );
  };

  const handleSearchKeyword = (keyword) => {
    setSearchKeyword(keyword);
    dispatch({ type: "SEARCH_BY", search: keyword });
  };
  return (
    <Fragment>
      <Breadcrumb title="Product" parent="Ecommerce" />
      {loaderFlag ? (
        <Loader />
      ) : (
        <div className="container-fluid product-wrapper">
          <div className="product-grid">
            {/* filter & Search div */}
            <div className="feature-products">
              <div className="row">
                <div className="col-md-6 products-total">
                  <div className="square-product-setting d-inline-block">
                    <a
                      className="icon-grid grid-layout-view "
                      href="#javascript"
                      onClick={gridLayout}
                      data-original-title=""
                      title=""
                    >
                      <Grid />
                    </a>
                  </div>
                  <div className="square-product-setting d-inline-block">
                    <a
                      className="icon-grid m-0 list-layout-view"
                      href="#javascript"
                      onClick={listLayout}
                      data-original-title=""
                      title=""
                    >
                      <List />
                    </a>
                  </div>
                  <span
                    className="d-none-productlist filter-toggle"
                    onClick={() => setFilterSidebar(!filterSidebar)}
                  >
                    <h6 className="mb-0">
                      {Filters}
                      <span className="ml-2">
                        <ChevronDown className="toggle-data" />
                      </span>
                    </h6>
                  </span>
                  <div className="grid-options d-inline-block">
                    <ul>
                      <li>
                        <a
                          className="product-2-layout-view"
                          href="#javascript"
                          onClick={() => LayoutView(6)}
                          data-original-title=""
                          title=""
                        >
                          <span className="line-grid line-grid-1 bg-primary"></span>
                          <span className="line-grid line-grid-2 bg-primary"></span>
                        </a>
                      </li>
                      <li>
                        <a
                          className="product-3-layout-view"
                          href="#javascript"
                          onClick={() => LayoutView(4)}
                          data-original-title=""
                          title=""
                        >
                          <span className="line-grid line-grid-3 bg-primary"></span>
                          <span className="line-grid line-grid-4 bg-primary"></span>
                          <span className="line-grid line-grid-5 bg-primary"></span>
                        </a>
                      </li>
                      <li>
                        <a
                          className="product-4-layout-view"
                          href="#javascript"
                          onClick={() => LayoutView(3)}
                          data-original-title=""
                          title=""
                        >
                          <span className="line-grid line-grid-6 bg-primary"></span>
                          <span className="line-grid line-grid-7 bg-primary"></span>
                          <span className="line-grid line-grid-8 bg-primary"></span>
                          <span className="line-grid line-grid-9 bg-primary"></span>
                        </a>
                      </li>
                      <li>
                        <a
                          className="product-6-layout-view"
                          href="#javascript"
                          onClick={() => LayoutView(2)}
                          data-original-title=""
                          title=""
                        >
                          <span className="line-grid line-grid-10 bg-primary"></span>
                          <span className="line-grid line-grid-11 bg-primary"></span>
                          <span className="line-grid line-grid-12 bg-primary"></span>
                          <span className="line-grid line-grid-13 bg-primary"></span>
                          <span className="line-grid line-grid-14 bg-primary"></span>
                          <span className="line-grid line-grid-15 bg-primary"></span>
                        </a>
                      </li>
                    </ul>
                  </div>
                </div>
                <div className="col-md-6 text-right">
                  {/* <span className="f-w-600 m-r-10">Showing Products 1 - 24 Of {products.length} Results</span> */}
                  <div className="select2-drpdwn-product select-options d-inline-block">
                    <select
                      className="form-control btn-square"
                      onChange={(e) => filterSortFunc(e.target.value)}
                    >
                      <option value="">{"Sorting items"}</option>
                      <option value="HighToLow">{"Price: High to Low"}</option>
                      <option value="LowToHigh">{"Price: Low to High"}</option>
                      <option value="Newest">{"Newest Items"}</option>
                      <option value="AscOrder">{"Sort By Name: A To Z"}</option>
                      <option value="DescOrder">
                        {"Sort By Name: Z To A"}
                      </option>
                    </select>
                  </div>
                </div>
              </div>
              <div className="row">
                <div className="col-sm-3">
                  <div
                    className={`product-sidebar ${filterSidebar ? "" : "open"}`}
                  >
                    <div className="filter-section">
                      <div className="card">
                        <div className="card-header">
                          <h6 className="mb-0 f-w-600">
                            {Filters}
                            <span className="pull-right">
                              <i
                                className="fa fa-chevron-down toggle-data"
                                onClick={onClickFilter}
                              ></i>
                            </span>
                          </h6>
                        </div>
                        <div className="left-filter">
                          <div className="card-body filter-cards-view animate-chk">
                            <AllFilters />
                            <Carousal />
                            <div className="product-filter text-center">
                              <img
                                className="img-fluid banner-product"
                                src={banner}
                                alt=""
                                data-original-title=""
                                title=""
                              />
                            </div>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="col-md-9 col-sm-12">
                  <form>
                    <div className="form-group m-0">
                      <input
                        className="form-control"
                        type="text"
                        placeholder="search"
                        defaultValue={searchKeyword}
                        onChange={(e) => handleSearchKeyword(e.target.value)}
                      />
                    </div>
                  </form>
                </div>
              </div>
            </div>

            {/* div to discplay the products */}
            <div className="product-wrapper-grid">
              {searchKeyword.length > 0 ? (
                <div className="search-not-found text-center">
                  <div>
                    <img
                      className="img-fluid second-search"
                      src={errorImg}
                      alt=""
                    />
                    <p>{NotFoundData}</p>
                  </div>
                </div>
              ) : (
                <div className="row gridRow">
                  {products
                    ? products.map((item, i) => (
                        <div
                          className={`${
                            layoutColumns === 3
                              ? "col-xl-3 col-sm-6 xl-4 col-grid-box"
                              : "col-xl-" + layoutColumns
                          }`}
                          key={i}
                        >
                          <div className="card">
                            <div className="product-box">
                              <div className="product-img">
                                {item.status === "sale" ? (
                                  <span className="ribbon ribbon-danger">
                                    {item.status}
                                  </span>
                                ) : (
                                  ""
                                )}
                                {item.status === "50%" ? (
                                  <span className="ribbon ribbon-success ribbon-right">
                                    {item.status}
                                  </span>
                                ) : (
                                  ""
                                )}
                                {item.status === "gift" ? (
                                  <span className="ribbon ribbon-secondary ribbon-vertical-left">
                                    <i className="icon-gift">{item.status}</i>
                                  </span>
                                ) : (
                                  ""
                                )}
                                {item.status === "love" ? (
                                  <span className="ribbon ribbon-bookmark ribbon-vertical-right ribbon-info">
                                    <i className="icon-heart">{item.status}</i>
                                  </span>
                                ) : (
                                  ""
                                )}
                                {item.status === "Hot" ? (
                                  <span className="ribbon ribbon ribbon-clip ribbon-warning">
                                    {item.status}
                                  </span>
                                ) : (
                                  ""
                                )}
                                {/* <img className="img-fluid" src={require("../../../assets/images/" + item.img)} alt="" /> */}
                                <img
                                  className="img-fluid"
                                  src="data:image/jpeg;name=tshirt1.jpg;base64,"
                                  alt=""
                                />
                                <div className="product-hover">
                                  <ul>
                                    <li>
                                      <button
                                        className="btn"
                                        type="button"
                                        onClick={() => addcart(item, quantity)}
                                      >
                                        <i className="icon-shopping-cart"></i>
                                      </button>
                                    </li>
                                    <li>
                                      <button
                                        className="btn"
                                        type="button"
                                        data-toggle="modal"
                                        onClick={() => onOpenModal(item._id)}
                                        data-target="#exampleModalCenter"
                                      >
                                        <i className="icon-eye"></i>
                                      </button>
                                    </li>

                                    {/* wishlist Button later in project I will need this  */}
                                    {/* <li>
                                      <button
                                        className="btn"
                                        type="button"
                                        onClick={() => addWishList(item)}
                                      >
                                        <i className="icon-heart"></i>
                                      </button>
                                    </li> */}
                                  </ul>
                                </div>
                              </div>
                              <div className="product-details">
                                <h5>
                                  <a
                                    onClick={() => onClickDetailPage(item)}
                                    className="font-primary"
                                    href="#javascript"
                                  >
                                    {item.name}
                                  </a>
                                </h5>
                                <div className="product-price">
                                  <del>
                                    {symbol} {"555"}{" "}
                                  </del>
                                  {symbol} {item.price}
                                </div>
                              </div>
                            </div>
                          </div>
                        </div>
                      ))
                    : ""}

                  {/* View more modal */}
                  <Modal open={open} onClose={onCloseModal}>
                    <div className="modal-body">
                      <div className="product-modal row">
                        <div className="product-img col-md-6">
                          <img
                            className="img-fluid"
                            src="https://5.imimg.com/data5/PJ/DI/MY-3877854/round-neck-plain-tshirt-with-multi-color-design-500x500.png"
                            alt=""
                          />
                        </div>
                        <div className="product-details col-md-6 text-left">
                          <h3>{singleProduct.category}</h3>
                          <div className="product-price">
                            <del>
                              {symbol}
                              {"210"}
                            </del>{" "}
                            {symbol}
                            {singleProduct.price}
                          </div>
                          <div className="product-view">
                            <h6 className="f-w-600">{ProductDetails}</h6>
                            <p className="mb-0">
                              {singleProduct.productDetails}
                            </p>
                          </div>
                          <div className="product-size">
                            Available Sizes
                            <ul>
                              {ProductSizeArray.map((items, i) => (
                                <li key={i}>
                                  <button className="btn btn-outline-light">
                                    {items}
                                  </button>
                                </li>
                              ))}
                            </ul>
                          </div>
                          <div className="product-qnty">
                            <h6 className="f-w-600">{Quantity}</h6>
                            {/* <fieldset className="qty-box">
                              <div className="input-group">
                                <span className="input-group-prepend">
                                  <button
                                    type="button"
                                    className="btn quantity-left-minus"
                                    onClick={minusQty}
                                    data-type="minus"
                                    data-field=""
                                  >
                                    <i className="fa fa-minus"></i>
                                  </button>
                                </span>
                                <input
                                  type="text"
                                  name="quantity"
                                  value={quantity}
                                  onChange={changeQty}
                                  className="form-control input-number"
                                />
                                <span className="input-group-append">
                                  <button
                                    type="button"
                                    className="btn quantity-right-plus"
                                    onClick={plusQty}
                                    data-type="plus"
                                    data-field=""
                                  >
                                    <i className="fa fa-plus"></i>
                                  </button>
                                </span>
                              </div>
                            </fieldset> */}
                            <div className="addcart-btn">
                              {/* <button
                                className="btn btn-primary m-r-10"
                                type="button"
                                onClick={() => addcart(singleProduct, quantity)}
                              >
                                {AddToCart}
                              </button> */}
                              <button
                                className="btn btn-success"
                                type="button"
                                onClick={() => onClickDetailPage(singleProduct)}
                              >
                                {ViewDetails}
                              </button>
                            </div>
                          </div>
                        </div>
                      </div>
                    </div>
                  </Modal>
                </div>
              )}
            </div>
          </div>
        </div>
      )}
    </Fragment>
  );
};

const mapStateToProps = (state) => ({
  cart: state.Cart.cart,
  stateVar: state,
});

const mapDispatchToProps = (dispatch) => {
  return {
    addToCart: (product, qty) => dispatch(addToCart(product, qty)),
  };
};

export default compose(
  withRouter,
  connect(mapStateToProps, mapDispatchToProps)
)(EcommerceApp);
// export default EcommerceApp;
